import React, { useEffect, useState } from 'react';
function Get() {
  const [data, setData] = useState([]);
  // get Data

  useEffect(() => {
    fetch('http://localhost:9000/ApiYoutube')
      .then((res) => res.json())
      .then((data) => {
        // console.log('data:', data);
        setData(data);
      });
  }, []);
  return (
    <div className='App'>
      <h1>GET API </h1>
      <table border='1'>
        <tbody>
          <tr>
            <td>ID</td>
            <td>Name</td>
            <td>Email</td>
            <td>Password</td>
            <td>Action</td>
          </tr>
          {data.map((item, i) => (
            <tr key={i}>
              <td>{item.id}</td>
              <td>{item.name}</td>
              <td>{item.email}</td>
              <td>{item.password}</td>
              <td>
                <Delete>Delete</Delete>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Get;
